import { RangeSelector } from "grommet";
import PropTypes from "prop-types";
import React from "react";
const propTypes = {
  dates: PropTypes.arrayOf(PropTypes.string).isRequired
};
const defaultProps = {};

export default function TimeBar({ dates }) {
  const [values, handleChange] = React.useState([12, 13]);
  return (
    <section className="w-100 h3">
      {/* {dates &&
        dates.forEach(element => {
          helo;
        })} */}

      <RangeSelector
        values={values}
        min={0}
        max={24}
        step={1}
        color="#363d87"
        className="bg-light-gray "
        size="medium"
        onChange={handleChange}
      />
    </section>
  );
}

TimeBar.propTypes = propTypes;
TimeBar.defaultProps = defaultProps;
